import React from 'react';
import ImageGallery from 'react-image-gallery';
import "react-image-gallery/styles/css/image-gallery.css"



export default class Slide extends React.Component {
    render() {
        const images = [

          //colocar apenas imagens 1040x390
            {
              original: '/img/imagens/grande/11.jpg',
              thumbnail: '/img/imagens/thumb/1.jpg',
            },

            {
              original: '/img/imagens/grande/teste.jpg',
              thumbnail: '/img/imagens/thumb/teste.jpg',
            },
            {
                original: '/img/imagens/grande/2.jpg',
                thumbnail: '/img/imagens/thumb/2.jpg',
              },
              {
                original: '/img/imagens/grande/3.jpg',
                thumbnail: '/img/imagens/thumb/3.jpg',
              },
              {
                original: '/img/imagens/grande/4.jpg',
                thumbnail: '/img/imagens/thumb/4.jpg',
              },
        
            
          ];
          


        return (
            
            <ImageGallery 
              items={images} 
              autoPlay={true} 
              showThumbnails={false} 
              showFullscreenButton={false} 
              showPlayButton={false} 
              showNav={false} 
              slideInterval={8000}
              slideDuration={1200}
              fullscreen={true}
              
              />
            
        )
    }
}
